            <div>
                <span style={{ fontSize: '15px' }}> Designed and Built by Me: 
                    <a href='https://github.com/Steven7926/PortfolioSite' className="font-blue"> Github</a>
                </span>
            </div>
        </div>                     
    )
} export default Footer;
